import React from "react";
import { OverlayTrigger, Tooltip } from "react-bootstrap";
import { toAbsoluteUrl } from "../../../../../../../../../_metronic/_helpers";
import SVG from "react-inlinesvg";
import { NavigateBeforeSharp, NfcSharp } from "@material-ui/icons";

export  const ActionsColumnFormatter = (cellContent, row, rowIndex, { openReceivePage }) => (
  <>
    <OverlayTrigger
      overlay={<Tooltip id="products-edit-tooltip">
        {row.status === "RECEIVE" ? "Receive" : "Received"
        }
      </Tooltip>}
    >
     <button
        className={row.status === "RECEIVED" ? 
        "btn light-success-bg dark-success-color" : "btn text-white"
      }
        style={row.status === "RECEIVED" || row.status === "REJECTED" ? {cursor:"text"} : {background:"#0396FF"}}
        onClick={
          row.status === "RECEIVE" ? ()=>openReceivePage(row) : ""}
      >
        {row.status === "RECEIVE" ? 
         <SVG className="mr-1" src={toAbsoluteUrl("/media/svg/icons/project-svg/white-receive.svg")} />:
         <SVG className="mr-1" src={toAbsoluteUrl("/media/svg/icons/project-svg/approved-done.svg")} /> 
         }
        {row.status === "RECEIVE" ? "Receive" : "Received"}
      </button>
      
    </OverlayTrigger>
  </>
);
